import React, { useState, useEffect } from 'react';

function CabList() {
    // const [cabs, setCabs] = useState([]);
    const cabs = [
        {
            "name": "cab B",
            "status": "Busy"
        }
    ]
    useEffect(() => {
        // Fetch available cabs from your backend
        fetch('/api/available-cabs')
            .then((response) => response.json())
            .then((data) => setCabs(data))
            .catch((error) => console.error('Error fetching available cabs:', error));
    }, []);

    return (
        <div className="cab-list">
            <h2>Available Cabs</h2>
            <ul>
                {cabs.map((cab, index) => (
                    <li key={index}>
                        {cab.name} - Price per minute: ${cab.pricePerMinute}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default CabList;
